import style from './Todo.module.css';

function Todo() {
  return (
    <div className={style.task}>
      <p>Task Name</p>
      <div>
        <button className={style.deleteButton}>Delete</button>
        <button>Done!</button>
      </div>
    </div>
  );
}

export default Todo;
